TAIL = r"""
        </table>
        <div id="holder"></div>
        <p id="copy">Mingalev Oleg &copy; 2013+</p>
    </body>
</html>
"""
def generate_dates_html(period, values):
    ans = HEAD.replace('$$CNT$$', str(len(values)-1))
    ans += '<h1>' + period + '</h1>'
    ans += '<table id="data">'
    ans += '<tfoot>'
    ans += '<tr>'
    for i in range(len(values)):
        i += 1
        ans += '<th>' + str(i) + '</th>'
    ans += '</tr>'
    ans += '</tfoot>'
    ans += '<tbody>'
    ans += '<tr>'
    for i in values:
        ans += '<td>' + str(i) + '</td>'
    ans += '</tr>'
    ans += '</tbody>'
    ans += '</table>'
    ans += TAIL
    return ans

STATDIR = 'STATISTICS'

from filestructs import FileDict
from grubber import STATISTICS_FILE
import os

if __name__ == '__main__':
    import os
    if not os.path.isdir(STATDIR):
        os.mkdir(STATDIR)
    f = FileDict(STATISTICS_FILE)
    mounths = list(f.keys())
    mounths.sort(key=lambda x: x.split()[::-1])
    for i in range(len(mounths)):
        print('#%02d: %s' % (i+1, mounths[i]))
    print('Enter the number of period to make the report or just press Enter to choose the lastest')
    print('?', end = ' ')
    try:
        n = input()
        n = 1
        if not n:
            n = '-1'
        n = int(n)-1
        M = mounths[n]
    except:
        print('== ERROR ==')
        print('Invalid number')
        print('Press Enter...')
        input()
        exit()
    stat = f[M]
    filename = os.path.join(STATDIR, M)+'.html'
    with open(filename, 'w') as fh:
        fh.write(generate_dates_html(M, stat))
    import webbrowser
    webbrowser.open(filename)
